import React from "react";
import "./Product.css";

function Product() {
    return (
      <div className="product">
        <div className="product_info">
                <p>Xbox One X Cyberpunk 2077 Limited Edition Bundle (1TB)</p>
                <div className="product_price">
                    <small></small>
                </div>
        </div>
      </div>
    );
}

export default Product;
